import React, { useState, useEffect } from "react";

const API_URL = "http://www.omdbapi.com?apikey=71b33b21";

const App = () => {
  const searchMovies = async (title) => {
    const response = await fetch(`${API_URL}&s=${title}`);
    const data = await response.json();

    console.log(data);
  };

  useEffect(() => {
    searchMovies("Batman");
  }, []);

  return <h1>App</h1>;
};

export default App;
